// src/pages/Contato.js
import React from 'react';

const Contato = () => {
  return (
    <div>
      <h1>Contato</h1>
      <p>Se vocÃª deseja entrar em contato conosco, envie um e-mail para: <a href="mailto:contato@nareia.com">contato@nareia.com</a></p>
      <p>Ou nos siga nas redes sociais:</p>
      <ul>
        <li><a href="https://www.instagram.com/nareia" target="_blank" rel="noopener noreferrer">Instagram</a></li>
        <li><a href="https://www.youtube.com/c/nareia" target="_blank" rel="noopener noreferrer">YouTube</a></li>
      </ul>
    </div>
  );
};

export default Contato;
